import React from 'react'
import classes from './MealsSummary.module.css';
function MealsSummary() {
  return (
    <section className={classes.summary}>
        <h2>Delicious Food, Delivered To You</h2>
        <p>
            Choose your favorite meal from out broad selection of available meals and enjoy a delicious lunch or dinner at home.
        </p>
        <p>
            All our meals are cooked with high-quality ingredients, just-in-tim and of course by experienced chefs !
        </p>
    </section>
  )
}

export default MealsSummary
